// Storage Periphery Extract — FULL REPLACE v5.0 (read combined file, produce digest_periphery_text only)

const fs = require('fs');
const base = $input.item.json || {};
const s = (x) => (x == null ? '' : String(x));

const fp = s(base.combinedLogPath).trim();
const MAX_READ = Number($env.LLM4_READ_CHARS || 3000000); // 3M chars head

function readHead(p, maxChars){
  try { return fs.readFileSync(p, 'utf8').slice(0, maxChars); } catch { return ''; }
}

function dedupMax(text, maxPer){
  const counts = new Map();
  const out = [];
  const lines = s(text).replace(/\r\n/g,'\n').split('\n');
  for (const line of lines) {
    const k = line.trim().replace(/\s+/g,' ').toLowerCase();
    if (!k) { out.push(line); continue; }
    const n = counts.get(k) || 0;
    if (n >= maxPer) continue;
    counts.set(k, n+1);
    out.push(line);
  }
  return out.join('\n');
}

const head = readHead(fp, MAX_READ);

const keep = [];
const rx = /(psu|power\s*supply|fan|sfp|qsfp|transceiver|port|i2c|temperature|volt|current|sensor|module|iom|expander)/i;

for (const line of head.replace(/\r\n/g,'\n').split('\n')) {
  if (rx.test(line)) keep.push(line);
  if (keep.length >= 12000) break;
}

let digest = keep.join('\n');
digest = dedupMax(digest, 3);

return [{
  json: {
    ...base,
    digest_periphery_text: digest || 'N/A',
  }
}];

// Storage Error Candidates — FULL REPLACE v7.1-no-xlsx
// Reads STORAGE_ERROR_KEYWORDS_XLSX without external modules (xlsx is disallowed in n8n task-runner).
// Uses: unzip -p <file.xlsx> <inner.xml> and parses sharedStrings + sheet XML.

const fs = require('fs');
const path = require('path');
const { spawnSync } = require('child_process');

const base = $input.item.json || {};
function s(x){ return x == null ? '' : String(x); }
function fileExists(p){ try { return !!p && fs.existsSync(p) && fs.statSync(p).isFile(); } catch { return false; } }

const DUP_MAX = 3;
const MODEL = s($env.LOGPARSER_REPORT_LLM).trim() || 'qwen2.5:32b-instruct-q8_0';
const MAX_LINES_OUT = Number(s($env.LLM5_MAX_LINES).trim() || '1800');
const CONTEXT = Number(s($env.LLM5_ERR_CONTEXT).trim() || '2');

function resolveCombinedPath(b){
  const p = s(b.combinedLogPath).trim();
  if (p && fileExists(p)) return { ok:true, path:p };
  return { ok:false, error:'No combinedLogPath from ULC (or file not found).' };
}

function pushDedupe(out, line, counts){
  const c = (counts.get(line) || 0) + 1;
  counts.set(line, c);
  if (c > DUP_MAX) return;
  out.push(line);
}

function norm(ln){ return s(ln).replace(/\r/g,'').trimEnd(); }

function readLinesStream(fp, onLine){
  const fd = fs.openSync(fp, 'r');
  const BUF = Buffer.alloc(1024 * 1024);
  let carry = '';
  try {
    while (true){
      const n = fs.readSync(fd, BUF, 0, BUF.length, null);
      if (!n) break;
      const chunk = carry + BUF.slice(0, n).toString('utf8');
      const parts = chunk.split(/\r?\n/);
      carry = parts.pop() || '';
      for (const ln of parts) onLine(ln);
    }
    if (carry) onLine(carry);
  } finally {
    try { fs.closeSync(fd); } catch {}
  }
}

function shBuf(cmd, args){
  // Return Buffer from stdout
  const r = spawnSync(cmd, args, { encoding: null, maxBuffer: 200 * 1024 * 1024 });
  return { ok: r.status === 0, status: r.status, stdout: r.stdout, stderr: r.stderr };
}

function shTxt(cmd, args){
  const r = spawnSync(cmd, args, { encoding: 'utf8', maxBuffer: 50 * 1024 * 1024 });
  return { ok: r.status === 0, status: r.status, stdout: s(r.stdout), stderr: s(r.stderr) };
}

function decodeXmlEntities(t){
  let x = s(t);
  x = x.replace(/&lt;/g,'<').replace(/&gt;/g,'>').replace(/&quot;/g,'"').replace(/&apos;/g,"'").replace(/&amp;/g,'&');
  x = x.replace(/&#x([0-9a-f]+);/ig, (_,h)=>String.fromCharCode(parseInt(h,16)));
  x = x.replace(/&#(\d+);/g, (_,d)=>String.fromCharCode(parseInt(d,10)));
  return x;
}

function unzipList(xlsxPath){
  const r = shTxt('unzip', ['-Z1', xlsxPath]);
  if (!r.ok) return [];
  return r.stdout.split('\n').map(x=>x.trim()).filter(Boolean);
}

function unzipReadText(xlsxPath, innerPath){
  const r = shBuf('unzip', ['-p', xlsxPath, innerPath]);
  if (!r.ok) return '';
  try { return r.stdout.toString('utf8'); } catch { return ''; }
}

function parseSharedStrings(xml){
  // returns array sharedStrings[index] = text
  const out = [];
  if (!xml) return out;
  const siRe = /<si\b[^>]*>([\s\S]*?)<\/si>/g;
  let m;
  while ((m = siRe.exec(xml))) {
    const block = m[1];
    const tRe = /<t\b[^>]*>([\s\S]*?)<\/t>/g;
    let t, parts = [];
    while ((t = tRe.exec(block))) {
      parts.push(decodeXmlEntities(t[1]));
    }
    out.push(parts.join(''));
  }
  return out;
}

function parseSheetKeywords(sheetXml, sharedStrings){
  if (!sheetXml) return [];

  // Parse rows
  const rowRe = /<row\b[^>]*r="(\d+)"[^>]*>([\s\S]*?)<\/row>/g;
  const cellRe = /<c\b([^>]*)>([\s\S]*?)<\/c>/g;

  const rows = new Map(); // rowNum -> { colLetters: value }
  let rm;
  while ((rm = rowRe.exec(sheetXml))) {
    const rowNum = parseInt(rm[1], 10);
    const rowBlock = rm[2];
    const rowObj = {};

    let cm;
    while ((cm = cellRe.exec(rowBlock))) {
      const attrs = cm[1] || '';
      const inner = cm[2] || '';

      const refM = attrs.match(/\br="([A-Z]+)(\d+)"/);
      if (!refM) continue;
      const col = refM[1];
      // const rnum = parseInt(refM[2],10);

      const tM = attrs.match(/\bt="([^"]+)"/);
      const typ = tM ? tM[1] : '';

      let val = '';
      if (typ === 's') {
        const vM = inner.match(/<v>([\s\S]*?)<\/v>/);
        if (vM) {
          const idx = parseInt(vM[1],10);
          val = (idx >= 0 && idx < sharedStrings.length) ? sharedStrings[idx] : '';
        }
      } else if (typ === 'inlineStr') {
        const tM2 = inner.match(/<t\b[^>]*>([\s\S]*?)<\/t>/);
        if (tM2) val = decodeXmlEntities(tM2[1]);
      } else {
        const vM = inner.match(/<v>([\s\S]*?)<\/v>/);
        if (vM) val = decodeXmlEntities(vM[1]);
      }

      val = s(val).trim();
      if (val) rowObj[col] = val;
    }

    rows.set(rowNum, rowObj);
  }

  // Determine header and target column
  const header = rows.get(1) || {};
  let targetCol = '';
  const want = ['keyword','phrase','text'];

  for (const col of Object.keys(header)) {
    const h = s(header[col]).trim().toLowerCase();
    if (want.includes(h) || want.some(w => h.includes(w))) { targetCol = col; break; }
  }
  if (!targetCol) {
    // fallback: first column present in header, else 'A'
    targetCol = Object.keys(header)[0] || 'A';
  }

  const keywords = [];
  const seen = new Set();
  const maxRows = 200000;

  for (let r = 2; r <= maxRows; r++) {
    const rowObj = rows.get(r);
    if (!rowObj) continue;
    const k = s(rowObj[targetCol]).trim();
    if (!k) continue;
    const kk = k.toLowerCase();
    if (kk === 'keyword' || kk === 'phrase' || kk === 'text') continue;
    if (k.length > 240) continue;
    if (seen.has(kk)) continue;
    seen.add(kk);
    keywords.push(k);
    if (keywords.length >= 5000) break;
  }

  return keywords;
}

function loadKeywordsFromXlsxNoLib(xlsxPath){
  if (!fileExists(xlsxPath)) return [];

  // Need unzip
  const test = shTxt('sh', ['-lc', 'command -v unzip >/dev/null 2>&1 && echo ok || echo no']);
  if (!test.ok || !test.stdout.includes('ok')) return [];

  const list = unzipList(xlsxPath);
  const sheetPath =
