function escapeRegex(x) { return s(x).replace(/[.*+?^${}()|[\]\\]/g, '\\$&'); }

function severityHeuristic(termOrKw) {
  const k = s(termOrKw).toLowerCase();
  const critical = ['quarantine', 'fault', 'fatal', 'panic', 'assert', 'uncorrectable', 'offline', 'missing', 'failed', 'fail'];
  const major = ['degraded', 'error', 'timeout', 'rebuild', 'recovery', 'failover', 'crc', 'corrupt'];
  const warning = ['warn', 'warning', 'alarm', 'battery', 'temp', 'temperature', 'fan', 'power', 'voltage'];
  if (critical.some((x) => k.includes(x))) return 'Critical';
  if (major.some((x) => k.includes(x))) return 'Major';
  if (warning.some((x) => k.includes(x))) return 'Warning';
  return 'Minor';
}
function componentHeuristic(line) {
  const t = s(line).toLowerCase();
  if (t.includes('disk group') || t.includes('vdisk') || t.includes('dg')) return 'DiskGroup';
  if (t.includes('drive') || t.includes('disk') || t.includes('slot') || t.includes('enclosure')) return 'Disk';
  if (t.includes('controller') || t.includes('iom')) return 'Controller';
  if (t.includes('psu') || t.includes('power supply')) return 'PSU';
  if (t.includes('fan')) return 'Fan';
  if (t.includes('port') || t.includes('host')) return 'HostPort';
  return 'Other';
}

function buildRegex(terms) {
  const clean = terms
    .map((t) => s(t).trim())
    .filter((t) => t && t.length >= 3)
    .slice(0, 1200)
    .map(escapeRegex);
  if (!clean.length) return null;
  // single regex is OK here because digest is already filtered
  return new RegExp(`(?:${clean.join('|')})`, 'ig');
}

