          term,
          severity: sev,
          component: comp,
          kb: 'N/A',
          source: source || 'N/A',
          line: sourceLine ? Number(sourceLine) || 'N/A' : 'N/A',
          evidence: line.replace(/^\[source\s+[^\]]+\]\s*/, '').trim(),
